import Link from "next/link";

const Home = (props) => (
  <ul>
    <li>
      <Link href="/b" as="/a">
        <a>a</a>
      </Link>
    </li>
    <li>
      <Link href="/a" as="/b">
        <a>b</a>
      </Link>
    </li>
  </ul>
);

Home.getInitialProps = async function (context) {
  const site = context.query;
  // By returning { props: posts }, the Blog component
  // will receive `posts` as a prop at build time
  return {
    site,
  };
};

export default Home;
